import React from 'react';
import './Common.css';

const Qualifying: React.FC = () => {
  return (
    <div className="page-container">
      <section className="page-hero">
        <div className="hero-background"><div className="hero-grid"></div></div>
        <div className="hero-content">
          <div className="animated-badge"><span className="badge-icon">⚡</span><span>QUALIFYING</span></div>
          <h1 className="hero-title">QUALIFYING RESULTS</h1>
          <p className="hero-subtitle">Grid Position Battles</p>
        </div>
      </section>
      <section className="content-section">
        <div className="coming-soon">
          <h2>⚡ Qualifying Page</h2>
          <p>Qualifying results coming soon!</p>
        </div>
      </section>
    </div>
  );
};

export default Qualifying;
